import { Typography } from "@mui/material";
import React from "react";
import { Box } from "@mui/system";
import TextField from '@mui/material/TextField';
import TextareaAutosize from '@mui/material/TextareaAutosize';
import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import { FormLabel } from "@mui/material";
import { FormControlLabel } from "@mui/material";
import { FormControl } from "@mui/material";
import { Button } from "@mui/base";

function AddressDetails(){
    return(
        <Box sx={{
            display:'flex',
            flexDirection:'column',
            width:'60vw',

            height:450,
            justifyContent:'space-between'


        }}>
            <Box sx={{
            display:'flex',
            flexDirection:'row',
            justifyContent:'space-around',
            width:'100%'}}>
            <Typography sx={{position:'relative',right:200}}>Customer Details</Typography>
            <Typography sx={{border:'1px solid black',position:'relative',left:200}}>Address Details</Typography>
            </Box>


            <Box sx={{
            display:'flex',
            flexDirection:'column',
            width:'100%',
            height:400,alignItems:'center'

                }}>
                    <Box sx={{
                        display:'flex',
                        justifyContent:'space-around',
                        width:'100%',
                        marginTop:2

                    }}>
                            <TextField id="outlined-basic" label="firstname" variant="outlined" sx={{width:'40%'}} />
                            <TextField id="outlined-basic" label="lastname" variant="outlined" sx={{width:'40%'}} />
                            </Box>
                           <TextareaAutosize
                            aria-label="minimum height"
                            minRows={3}
                            placeholder="Minimum 3 rows"
                            style={{ width: '89%',marginTop:35 }}
                          />



                  <  Box sx={{
                        display:'flex',
                        justifyContent:'space-around',
                        width:'100%',
                        marginTop:2

                    }}>
                            <TextField id="outlined-basic" label="state" variant="outlined" sx={{width:'40%'}} />
                            <TextField id="outlined-basic" label="city" variant="outlined" sx={{width:'40%'}} />
                            </Box>

                            <FormControl sx={{marginTop:3}} >

                                 <FormLabel id="demo-controlled-radio-buttons-group" sx={{position:'relative',right:450}}>Type</FormLabel>
                                 <RadioGroup sx={{display:'flex',
                                     flexDirection:'row',justifyContent:'space-between'}}>


                                    <FormControlLabel value="home"  control={<Radio />} label="home" sx={{position:'relative',right:300}} />
                                        <FormControlLabel value="office" control={<Radio />} label="office" />
                                        <FormControlLabel value="other" control={<Radio />} label="other" sx={{position:'relative',left:300}}/>


                                </RadioGroup>

                            </FormControl>


            </Box>
            <button style={{width:50,
              position:'relative',
              left:1000}}>sfdf</button>

        </Box>
    )


}
export default AddressDetails
